# scrape_industry_urls 함수는 기존과 동일
def scrape_industry_urls() -> pd.DataFrame:
    """
    네이버 금융에서 일간 상승률 기준 상위 업종 목록을 스크래핑하여 DataFrame으로 반환합니다.
    """
    url = f"{BASE_DOMAIN}/sise/sise_group.naver?type=upjong"
    # print(f"-> 업종 목록 페이지 요청: {url}") # Flask에서는 print를 최소화합니다.

    try:
        response = requests.get(url, headers=HEADERS)
        response.raise_for_status()

        soup = BeautifulSoup(response.content, 'html.parser', from_encoding=ENCODING)

        industries = []

        # 업종 목록 테이블 (class='type_1') 찾기
        industry_table = soup.find('table', class_='type_1')
        if not industry_table:
            return pd.DataFrame()

        # 테이블의 모든 행(tr) 처리
        rows = industry_table.find_all('tr')
        for row in rows:
            td_list = row.find_all('td')
            if len(td_list) < 2:
                continue

            td = td_list[0]
            a_tag = td.find('a')

            if a_tag and a_tag.has_attr('href'):
                industry_name = a_tag.get_text(strip=True)
                industry_url = f"{BASE_DOMAIN}{a_tag['href']}"

                industries.append({'업종명': industry_name, 'URL': industry_url})

        return pd.DataFrame(industries)

    except requests.RequestException as e:
        # print(f"웹페이지 요청 중 오류 발생: {e}")
        return pd.DataFrame()
    except Exception as e:
        # print(f"스크래핑 중 오류 발생: {e}")
        return pd.DataFrame()


# scrape_stock_data_from_industry 함수는 기존과 동일
def scrape_stock_data_from_industry(industry_url: str, industry_name: str) -> List[Dict[str, Any]]:
    """
    특정 업종 상세 페이지에서 종목 데이터(종목코드, 현재가, 거래대금, outShare)를 스크래핑합니다.
    """
    time.sleep(0.5)
    # print(f"- 종목 데이터 스크래핑 시작: {industry_name}") # Flask에서는 print를 최소화합니다.

    stock_data = []

    try:
        response = requests.get(industry_url, headers=HEADERS)
        response.raise_for_status()

        soup = BeautifulSoup(response.content, 'html.parser', from_encoding=ENCODING)

        # 종목 리스트 테이블 (class='type_5') 찾기
        stock_table = soup.find('table', class_='type_5')
        if not stock_table:
            # print(f"- 경고: 업종 '{industry_name}'의 종목 테이블을 찾을 수 없습니다.")
            return []

        # 테이블의 모든 종목 행(tr) 찾기.
        rows = stock_table.find_all('tr', {'onmouseover': 'mouseOver(this)'})

        for row in rows:
            tds = row.find_all('td')

            if len(tds) < 9:
                continue

            try:
                # 1. 종목 코드와 종목명 추출
                name_td = tds[0]
                a_tag = name_td.find('a')

                if not a_tag or not a_tag.has_attr('href'):
                    continue

                href = a_tag['href']
                code_match = re.search(r'code=(\d{6})', href)

                if code_match:
                    stock_code = code_match.group(1).zfill(6)
                else:
                    stock_code = None

                stock_name = a_tag.get_text(strip=True)

                if not stock_code:
                    continue

                # 2. 현재가 추출 (인덱스 1)
                closePrice_text = tds[1].get_text(strip=True).replace(',', '')

                # 3. 거래대금 추출 (인덱스 7)
                trading_value_text = tds[7].get_text(strip=True).replace(',', '')

                # 4. OUTSTANDING_SHARES 맵에서 outShare 값 가져오기
                out_share = OUTSTANDING_SHARES_MAP.get(stock_code, 0) / 100000000

                # 종목메모에는 유통총액이 들어가야 하므로, 업종명은 '업종명' 컬럼에 저장
                stock_data.append({
                    "종목코드": stock_code,
                    "현재가_텍스트" : closePrice_text,
                    "종목명": stock_name,
                    "업종명": industry_name,
                    "거래대금_텍스트": trading_value_text,
                    "outShare": out_share,
                })

            except Exception:
                continue

        # print(f"- 종목 데이터 {len(stock_data)}개 추출 완료.")
        return stock_data

    except requests.RequestException as e:
        # print(f"- 오류: 업종 '{industry_name}' 페이지 요청 중 오류 발생: {e}")
        return []
    except Exception as e:
        # print(f"- 오류: 업종 '{industry_name}' 스크래핑 중 오류 발생: {e}")
        return []


def get_stock_data() -> str:
    """
    스크래핑 및 데이터 처리를 수행하고 결과를 HTML 테이블 문자열로 반환합니다.
    """
    # print("=== 네이버 금융 일간 상승률 기준 상위 5개 업종 종목 데이터 스크래퍼 ===")

    # 1. 상위 5개 업종 목록 스크래핑
    industries_df = scrape_industry_urls()

    if industries_df.empty:
        return "<h3>오류: 스크래핑된 업종 목록이 없습니다.</h3>"

    # 상위 79개 업종만 선택
    all_industries_df = industries_df.head(79)
    # total_industries = len(all_industries_df)

    all_stock_data = []

    # 2. 종목 데이터 추출
    for index, row in all_industries_df.iterrows():
        industry_name = row['업종명']
        industry_url = row['URL']

        stock_list = scrape_stock_data_from_industry(industry_url, industry_name)

        all_stock_data.extend(stock_list)

    if not all_stock_data:
        return "<h3>오류: 추출된 종목 데이터가 없습니다.</h3>"

    # 3. 데이터 정리, 변환 및 유통총액 계산
    stock_df = pd.DataFrame(all_stock_data)

    # 중복 종목 제거
    stock_df = stock_df.drop_duplicates(subset=['종목코드'], keep='first')

    try:
        # 거래대금과 현재가를 숫자로 변환
        stock_df['거래대금'] = pd.to_numeric(stock_df['거래대금_텍스트'], errors='coerce')
        stock_df['현재가'] = pd.to_numeric(stock_df['현재가_텍스트'], errors='coerce')

        # 유통총액 계산 (억 원): outShare가 백만주 단위(1,000,000)라고 가정
        # 유통총액 (억 원) = (현재가 * outShare * 10)
        stock_df['유통총액_억'] = (stock_df['현재가'] * stock_df['outShare'] * 10)

        # ✅ 유통총액을 '종목메모'에 저장 (소수점 제거 및 '억' 추가 포맷)
        stock_df['종목메모'] = stock_df['유통총액_억'].apply(
             lambda x: f'{int(x):,}' + '억' if pd.notna(x) else x # 천 단위 구분 기호 추가
        ).fillna('유통총액 N/A')

        # 불필요한 텍스트 컬럼 제거.
        stock_df = stock_df.drop(columns=['거래대금_텍스트', '현재가_텍스트', 'outShare'], errors='ignore')

    except Exception as e:
        return f"<h3>오류: 데이터 형식 변환 및 유통총액 계산 중 오류 발생: {e}</h3>"

    # 4. 거래대금 기준으로 정렬하고 상위 2700개 선택 (필터링)
    stock_df_sorted = stock_df.sort_values(by='거래대금', ascending=False).dropna(subset=['거래대금'])
    top_stocks = stock_df_sorted.head(2700).copy()

    # 5. 최종 정렬: 유통총액_억 (종목메모의 숫자 원천 데이터)을 기준으로 내림차순 정렬
    final_df = top_stocks.sort_values(
        by='유통총액_억',
        ascending=False
    ).copy()

    # 최종 결과 DataFrame에 필요한 컬럼만 선택하고, 숫자 컬럼은 HTML 출력 전에 제거/포맷
    final_df = final_df[['종목코드', '종목명', '종목메모', '업종명', '거래대금']]

    # 거래대금 포맷팅 (천 단위 구분 기호)
    final_df['거래대금'] = final_df['거래대금'].apply(lambda x: f'{int(x):,}' if pd.notna(x) else 'N/A')

    # 인덱스 제거
    final_df = final_df.reset_index(drop=True)
    final_df.index = final_df.index + 1 # 1부터 시작하는 인덱스

    # 6. HTML 테이블로 변환
    html_table = final_df.to_html(
        classes='table table-striped table-hover', # Bootstrap 스타일 클래스
        border=0,
        justify='center',
        escape=False # 종목메모의 '억' 등을 그대로 출력
    )

    return html_table


@app.route('/')
def index():
    """
    웹 요청을 처리하고 데이터를 스크래핑한 후 템플릿에 렌더링합니다.
    """
    # 데이터 스크래핑 및 HTML 테이블 생성
    html_table_content = get_stock_data()
    current_time = datetime.now().strftime("%Y년 %m월 %d일 %H시 %M분")

    # Markup을 사용하여 HTML 문자열이 안전하게 템플릿으로 전달되도록 합니다.
    return render_template('index.html',
                           table_html=Markup(html_table_content),
                           timestamp=current_time)

